	VALUES(178035, 240111044331052505, '金地商置Ibase原点', '金地商置Ibase原点', manager_uid, '13601351172', '北京市朝阳区建国路91号金地中心B座18层', 1790, NULL, NULL, NULL, '北京金地中心位于大望路与国贸的CBD商圈，毗邻华贸中心和万达广场，属于北京甲A级写字楼。ibase商务中心是金地集团自营联合办公场所，位于金地中心B座18层。大气低调的装修风格以及完善的办公配套设施，专业的服务人员使您的办公简易', NULL, 2, 1, UTC_TIMESTAMP(), 1, UTC_TIMESTAMP(), NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 999989);
	VALUES(178036, 240111044331052506, '金谷创业园B栋', '金谷创业园B栋', manager_uid, '13763358359', '南山区西丽龙珠四路金谷创业园B栋5层', 2500, NULL, NULL, NULL, '项目位于金谷创业园内，是大沙河创新走廊重点项目已获得政府政策补贴，为“一街道一园区”重点项目，南侧紧邻北环大道及广深高速，北侧为龙珠大道，东侧为高发科技园，西侧隔龙珠四路与西丽车管所毗邻，150米近距龙井地铁站，可直达科', NULL, 2, 1, UTC_TIMESTAMP(), 1, UTC_TIMESTAMP(), NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 999989);
	VALUES(178037, 240111044331052507, '威新软件园7号楼', '7号楼', manager_uid, '0755-23180904（8904）', '广东省深圳市南山区高新南九道威新软件园7号楼1-2层', 3000, NULL, NULL, NULL, '位于国家重点支持的五大科技园区之一的深圳科技园南区，与英特尔、阿里巴巴、蚂蚁金服、伟创力、招商证券等知名企业为邻。威新中心提供1-200人团队的办公室，可根据企业需求定制空间与设施，拎包进驻，即租即用，中心内高速网络全面覆', NULL, 2, 1, UTC_TIMESTAMP(), 1, UTC_TIMESTAMP(), NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 999989);
	VALUES(178038, 240111044331052508, '竹盛花园三期裙楼', '竹盛花园', manager_uid, '13685626475', '广东省深圳市福田区竹子林三路竹盛花园三期裙楼201室', 3250, NULL, NULL, NULL, '项目位属大华侨城片区，园博园、华侨城loft工业园、锦绣中华、世界之窗、欢乐谷等自然人文资源相当丰富。成熟住宅片区，商业配套丰富，学校、银行、医院、餐饮、商业一应俱全，更有美食一条街。深南大道沿线，“深圳人才园”公交站', NULL, 2, 1, UTC_TIMESTAMP(), 1, UTC_TIMESTAMP(), NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 999989);
    
